import React from 'react'
import classes from "./ImageText.module.scss";

const ImageText = () => {
  return (
    <div className={classes.textimage_container}>
        <div className={classes.textimage_image}>
        <div className={classes.textimage_imagesize}>

        <Link to="/about">
        <a
          src="//cdn.shopify.com/s/files/1/0598/2194/9121/files/NRC_logo_svg_110x.png?v=1675719317 110w, //cdn.shopify.com/s/files/1/0598/2194/9121/files/NRC_logo_svg_220x.png?v=1675719317 220w"
          alt="example"
        />
      </Link>


          </div>
        </div>
        <div className={classes.textimage_text}>ImageText</div>
    </div>
  )
}

export default ImageText;
